script: |
  super -f text -I q813.spq | sort > q813.out

inputs:
  - name: q813.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE NOT ( NOT - 5 * - col0 NOT IN ( + - col0, - col1 / + + 30, - 82 / + col2 + + col0 / col1, - + 10, + 58, col2, col0, + col2 ) );
  - name: tab1

outputs:
  - name: q813.out
    data: |
      51	14	96
      85	5	59
      91	47	68
